/*
	START: Managing deep link marketing campaigns including redriects
*/
var config = {
  site:_satellite.getVar("level1"),   
  cookieDomain: _satellite.getVar('cookieDomain')
};
var context = {};

try{
	for(var i = 0; i < digitalDataWebshop.event.length; i++)
		if(digitalDataWebshop.event[i].eventInfo.eventName == "Marketing") {
			
			var type = 'AD';
			var campaign = '';	//channel, e.g. '1' for Newsletter
			var creation = '[]';	//keyword, e.g. 'sbb' --> PPC only
			var format = '[]';	//language, e.g. 'en' --> PPC only
			var variant = '[]';	//matchtype, e.g. 'e' --> PPC only*/
			var generalPosition = '[]';	//campain
			var detailedPosition = '[]';	//adgroup --> PPC only*/
			
			if(digitalDataWebshop.event[i].category.primaryCategory.toLowerCase() == "affiliation") {
				campaign = '4';
				generalPosition = '[' + digitalDataWebshop.event[i].category.subCategory1 + ']';
			}
			
			var advertisement = type + '-' + campaign + '-' + creation + '-' + variant + '-' + format + '-[]-' + generalPosition + '-' + detailedPosition; 
			
			_satellite.notify(advertisement, 4);
			
			context = {
				forcedCampaign: advertisement	//'AD-X-[...]-[...]-[...]-[]-[...]-[...]'
			};
			
			_satellite.notify(context.forcedCampaign, 4);
		}
} catch(err) {}
/*
	END: Managing deep link marketing campaigns including redriects
*/

//OLD: Initialization
/*var ATInternetTag = new ATInternet.Tracker.Tag({
 //site: _satellite.getVar('level1')
});*/

//NEW: Initialization
var atInternetTag = new ATInternet.Tracker.Tag(config, context);
//Creating custom object for custom analysis
